The four Legionnaires arrive on Earth to find Universo, the person behind the recent troubles in their lives. Believing that Universo is masquerading as the President of Earth, they reach his offices to learn that it's not the President, but someone close to them. They are then forced to fighting some of their teammates from the Legion of Super-Heroes, hypnotized by Universo. Saturn Girl takes on Universo directly, and wins. After the battle, she returns to active duty as a member of the Legion of Super-Heroes.

